create table company_sector
(
    id           bigserial
        constraint company_sector_pk
            primary key,
    company_name varchar(255)
        constraint company_sector_crypto_company_name_fk
            references crypto_company (name),
    sector       text
);

alter table company_sector
    owner to application;

create unique index company_sector_id_uindex
    on company_sector (id);

